// Codon position nucleotide frequencies
// Order: A=0, C=1, G=2, T=3
constexpr float FUNGI_CODON_POS0_NT_FREQ[4] = {
    0.261413f, 0.232758f, 0.330562f, 0.175267f
};

constexpr float FUNGI_CODON_POS1_NT_FREQ[4] = {
    0.299872f, 0.261414f, 0.178861f, 0.259853f
};

constexpr float FUNGI_CODON_POS2_NT_FREQ[4] = {
    0.185560f, 0.316581f, 0.264211f, 0.233649f
};

// GC content by codon position
constexpr float FUNGI_GC1 = 0.563320f;
constexpr float FUNGI_GC2 = 0.440275f;
constexpr float FUNGI_GC3 = 0.580792f;  // Wobble position

/**
 * Calculate frame score using dicodon phase hexamers
 * 
 * @param seq DNA sequence
 * @param frame Reading frame (0, 1, or 2)
 * @return Log-likelihood ratio score (higher = more likely this frame)
 */
inline float calculate_fungi_frame_score(const char* seq, size_t len, int frame) {
    if (len < 6 || frame < 0 || frame > 2) return 0.0f;
    
    float llr_sum = 0.0f;
    int count = 0;
    constexpr float UNIFORM = 1.0f / 4096.0f;
    
    extern uint32_t encode_hexamer(const char*);
    
    // Score each hexamer position
    for (size_t i = 0; i + 5 < len; i++) {
        uint32_t code = encode_hexamer(seq + i);
        if (code >= 4096) continue;
        
        // What phase would this position be in if we're in 'frame'?
        // phase = (i - frame + 300) % 3
        int phase = (static_cast<int>(i) - frame + 300) % 3;
        
        float freq;
        switch (phase) {
            case 0: freq = FUNGI_PHASE0_HEXAMER_FREQ[code]; break;
            case 1: freq = FUNGI_PHASE1_HEXAMER_FREQ[code]; break;
            case 2: freq = FUNGI_PHASE2_HEXAMER_FREQ[code]; break;
            default: freq = UNIFORM;
        }
        
        if (freq > 1e-10f) {
            llr_sum += std::log(freq / UNIFORM);
            count++;
        }
    }
    
    return count > 0 ? llr_sum / count : 0.0f;
}

/**
 * Select best frame using dicodon phase analysis
 * 
 * @param seq DNA sequence
 * @param len Sequence length
 * @return Best frame (0, 1, or 2) and score difference from second best
 */
inline std::pair<int, float> select_fungi_best_frame(const char* seq, size_t len) {
    float scores[3];
    scores[0] = calculate_fungi_frame_score(seq, len, 0);
    scores[1] = calculate_fungi_frame_score(seq, len, 1);
    scores[2] = calculate_fungi_frame_score(seq, len, 2);
    
    int best = 0;
    if (scores[1] > scores[best]) best = 1;
    if (scores[2] > scores[best]) best = 2;
    
    // Find second best for confidence calculation
    float second_best = (best == 0) ? scores[1] : scores[0];
    for (int i = 0; i < 3; i++) {
        if (i != best && scores[i] > second_best) second_best = scores[i];
    }
    
    return {best, scores[best] - second_best};
}

